from typing import List
import collections


class Solution:
    def hasGroupsSizeX(self, deck: List[int]) -> bool:
        tmp = collections.Counter(deck)
        N = len(deck)
        for X in range(2, N + 1):
            if N % X == 0:
                if all(v % X == 0 for v in tmp.values()):
                    return True
        return False


